at are related by birth, marriage, or adoption. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"_5YEARINCREMENTSMEDAGE_CY":{"type":"number","alias":"2023 Median Age","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Median Age of the population in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HEALTHMEDHINC_CY":{"type":"number","alias":"2023 Median Household Income","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of Median Household Income in the geographic area. Median Household Income is the amount that divides household income (annual income for all household earners age 15+) into two equal groups in a geographic area; half of the population will have income higher than the median and half will have lower income. If the median falls in the upper income interval of $200,000+, it is represented by the value of $200,001. Esri uses the U.S. Census definition of income; reference <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>Esri Essential Vocabulary</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"KEYUSFACTSMEDVAL_CY":{"type":"number","alias":"2023 Median Home Value","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Median Home Value in the geographic area. Median Home Value divides home values into two equal groups; half of the homes will have a value higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"HOUSINGUNITTOTALSHAI_CY":{"type":"number","alias":"2023 Housing Affordability Index","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Housing Affordability Index (HAI) measures the ability of a typical resident to purchase a home in the geographic area. The HAI has a base of 100, representing where the median income is sufficient to qualify for a loan on a median-valued home and not be cost-burdened (cost-burdened=greater than 30% of income spent on housing). HAI values > 100 indicate increasing affordability; HAI values < 100 indicate areas where homes are less affordable and median income might be insufficient to purchase a median-valued home.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"ELECTRONICSINTERNETMP19001A_B_P":{"type":"number","alias":"2023 Have Internet Access at Home: Percent","vintage":"2023","source":"Esri-MRI-Simmons","units":null,"decimals":null,"definition":"Esri 2023 estimate of the expected number of adults and Market Potential Index (MPI) for <em>2023 Have Internet Access at Home</em> in the geographic area. Esris Market Potential data provides information about the likely demand for specific products or services, as well as expected consumer attitudes and behaviors, in an area. The MPI compares local consumer demand, attitudes, and behaviors to U.S. levels. The MPI value for the U.S. is 100. If, for example, the MPI value for a geographic area is 150 this implies that consumer demand in the geographic area is likely to be 50% more than the  (#) of the Daytime Population who are Workers in the geographic area. Daytime Workers include population age 16+ who are civilian, non-military at work (commuters and non-commuters), and armed forces (on and off base). See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"DAYTIMEPOPULATIONDPOPRES_CY_P":{"type":"number","alias":"2023 Daytime Pop: Residents: Percent","vintage":"2023","source":"Esri-Data Axle","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Daytime Population who are Residents in the geographic area. Daytime Residents include population age 0-15; unemployed adults; those not in the Labor Force such as retirees, homemakers, college students, residents of institutions and non-institutional group homes, detention centers and shelters; and employed civilians who are temporarily not working due to illness, vacation, bad weather, labor dispute, etc. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"INDUSTRYEMP_CY":{"type":"number","alias":"2023 Employed Civilian Pop 16+","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Employed Civilian Population Age 16+ in the geographic area. Employed Civilian Population include those who are non-military employees or are self-employed, including those who work 15 hours or more for a family business (paid or unpaid) or those who are temporarily absent from work due to illness, vacation, or other personal reasons. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"INDUSTRYUNEMP_CY":{"type":"number","alias":"2023 Unemployed Population 16+","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Unemployed Population Age 16+ in the geographic area. Unemployed Population include those who are not on active duty in the Armed Forces, neither currently working nor waiting to work a job they hold, and have actively sought employment during the past four weeks and are available to work if hired; includes temporarily laid off employees. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"ATRISKACSHHBPOV":{"type":"number","alias":"2021 HHs: Inc Below Poverty Level (ACS 5-Yr)","vintage":"2017-2021","source":"ACS","units":null,"decimals":null,"definition":"ACS five-year estimate of the number of Households with income Below the Poverty Level in the geographic area. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designates the usability of the estimate. See <a target='_blank' href=\"https://links.esri.com/demographics/acs\">ACS data</a> for more information."},"ATRISKACSSNAP":{"type":"number","alias":"2021 HHs w/Food Stamps/SNAP (ACS 5-Yr)","vintage":"2017-2021","source":"ACS","units":null,"decimals":null,"definition":"ACS five-year estimate of the number of Households Receiving Food Stamps or SNAP in the geographic area. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designates the usability of the estimate. See <a target='_blank' href=\"https://links.esri.com/demographics/acs\">ACS data</a> for more information."},"ATRISKACSHHBPOV_P":{"type":"number","alias":"2021 HHs: Inc Below Poverty Level (ACS 5-Yr): Percent","vintage":"2017-2021","source":"ACS","units":null,"decimals":null,"definition":"ACS five-year estimate of the number of Households with income Below the Poverty Level in the geographic area. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designates the usability of the estimate. See <a target='_blank' href=\"https://links.esri.com/demographics/acs\">ACS data</a> for more information."},"ATRISKACSSNAP_P":{"type":"number","alias":"2021 HHs w/Food Stamps/SNAP (ACS 5-Yr): Percent","vintage":"2017-2021","source":"ACS","units":null,"decimals":null,"definition":"ACS five-year estimate of the number of Households Receiving Food Stamps or SNAP in the geographic area. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designates the usability of the estimate. See <a target='_blank' href=\"https://links.esri.com/demographics/acs\">ACS data</a> for more information."},"ATRISKACSHHDIS":{"type":"number","alias":"2021 HHs w/1+ Persons w/Disability (ACS 5-Yr)","vintage":"2017-2021","source":"ACS","units":null,"decimals":null,"definition":"ACS five-year estimate of the number of Households with 1+ Persons with a Disability in the geographic area. The U.S. Census Bureau defines disability broadly as difficulty with one of the following six basic areas of functioningambulation, cognition, hearing, independent living, self-care, and vision. Estimate and Margin of Error (MOE) from the U.S. Census American Community Survey (ACS) rolling sample 60-month survey; Esri Reliability measure designates the usability of the estimate. See <a target='_blank' href=\"https://links.esri.com/demographics/acs\">ACS data</a> for more information."},"_1YEARINCREMENTSAGE65_CY":{"type":"number","alias":"2023 Population Age 65","vintage":"2023","source":"Esri","units":null,"decimals":null,"definition":"Esri 2023 Estimate (#) of the Total Population Age 65 in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demogra ATRISKTOTPOP_CY":{"id":"TOTPOP_CY","fullName":"AtRisk.TOTPOP_CY","alias":"2023 Total Population","fieldName":"ATRISKTOTPOP_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.ATRISKTOTPOP_CY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Total Population in the geographic area. Total Population includes population living in households, on active duty in the Armed Forces, and living in group quarters such as correctional facilities, skilled nursing facilities, juvenile facilities, college dorms, and military barracks. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.ATRISKAVGHHSZ_CY":{"id":"AVGHHSZ_CY","fullName":"AtRisk.AVGHHSZ_CY","alias":"2023 Average Household Size","fieldName":"ATRISKAVGHHSZ_CY","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.ATRISKAVGHHSZ_CY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of Average Household Size in the geographic area. The Average Household Size is calculated by dividing the number of persons living in households by the total number of households in the current year. Households include all the people who occupy a housing unit (such as a house or apartment) as their usual residence.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.ATRISKTOTHH_CY":{"id":"TOTHH_CY","fullName":"AtRisk.TOTHH_CY","alias":"2023 Total Households","fieldName":"ATRISKTOTHH_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.ATRISKTOTHH_CY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Total Households in the geographic area. A household includes all people who occupy one housing unit (such as a house or apartment) as their usual residence. A household may include related family members, unrelated people, a person living alone, or a group of unrelated people sharing a housing unit, such as partners or roommates. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSPOPGRWCYFY":{"id":"POPGRWCYFY","fullName":"KeyUSFacts.POPGRWCYFY","alias":"2023-2028 Growth Rate: Population","fieldName":"KEYUSFACTSPOPGRWCYFY","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSPOPGRWCYFY","type":"esriFieldTypeDouble","vintage":"2028","source":"Esri","definition":"Esri 2028 five-year forecast for Population: Compound Annual Growth Rate (CAGR). The Population CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total Population between the years 2023 and 2028. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSHHGRWCYFY":{"id":"HHGRWCYFY","fullName":"KeyUSFacts.HHGRWCYFY","alias":"2023-2028 Growth Rate: Households","fieldName":"KEYUSFACTSHHGRWCYFY","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSHHGRWCYFY","type":"esriFieldTypeDouble","vintage":"2028","source":"Esri","definition":"Esri 2028 five-year forecast for Households: Compound Annual Growth Rate (CAGR). The Households CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in total Households between the years 2023 and 2028. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSFAMGRWCYFY":{"id":"FAMGRWCYFY","fullName":"KeyUSFacts.FAMGRWCYFY","alias":"2023-2028 Growth Rate: Families","fieldName":"KEYUSFACTSFAMGRWCYFY","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSFAMGRWCYFY","type":"esriFieldTypeDouble","vintage":"2028","source":"Esri","definition":"Esri 2028 five-year forecast for Families: Compound Annual Growth Rate (CAGR). The Families CAGR is an annualized measure that describes the direction (either positive or negative) and magnitude of change in the total number of families between the years 2023 and 2028. A family consists of two or more people residing together that are related by birth, marriage, or adoption. The CAGR is sometimes referred to as growth rate, annual rate, annualized growth rate, or compound growth rate; reference the <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>CAGR variable formula</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator._5YEARINCREMENTSMEDAGE_CY":{"id":"MEDAGE_CY","fullName":"5yearincrements.MEDAGE_CY","alias":"2023 Median Age","fieldName":"_5YEARINCREMENTSMEDAGE_CY","precision":1,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator._5YEARINCREMENTSMEDAGE_CY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Median Age of the population in the geographic area. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.HEALTHMEDHINC_CY":{"id":"MEDHINC_CY","fullName":"Health.MEDHINC_CY","alias":"2023 Median Household Income","fieldName":"HEALTHMEDHINC_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HEALTHMEDHINC_CY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of Median Household Income in the geographic area. Median Household Income is the amount that divides household income (annual income for all household earners age 15+) into two equal groups in a geographic area; half of the population will have income higher than the median and half will have lower income. If the median falls in the upper income interval of $200,000+, it is represented by the value of $200,001. Esri uses the U.S. Census definition of income; reference <a target='_blank' href='https://links.esri.com/esri-demographics/vocab'>Esri Essential Vocabulary</a>. See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.KEYUSFACTSMEDVAL_CY":{"id":"MEDVAL_CY","fullName":"KeyUSFacts.MEDVAL_CY","alias":"2023 Median Home Value","fieldName":"KEYUSFACTSMEDVAL_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.KEYUSFACTSMEDVAL_CY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Estimate (#) of the Median Home Value in the geographic area. Median Home Value divides home values into two equal groups; half of the homes will have a value higher than the median, and half lower. If the median is $2,000,000+, it is represented by a value of $2,000,001.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.HOUSINGUNITTOTALSHAI_CY":{"id":"HAI_CY","fullName":"housingunittotals.HAI_CY","alias":"2023 Housing Affordability Index","fieldName":"HOUSINGUNITTOTALSHAI_CY","precision":0,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.HOUSINGUNITTOTALSHAI_CY","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri","definition":"Esri 2023 Housing Affordability Index (HAI) measures the ability of a typical resident to purchase a home in the geographic area. The HAI has a base of 100, representing where the median income is sufficient to qualify for a loan on a median-valued home and not be cost-burdened (cost-burdened=greater than 30% of income spent on housing). HAI values > 100 indicate increasing affordability; HAI values < 100 indicate areas where homes are less affordable and median income might be insufficient to purchase a median-valued home.  See <a target='_blank' href='https://links.esri.com/demographics/updated-demographics'>Updated Demographics</a> for more information on Esri Demographic variables."},"dataCollectionsCalculator.ELECTRONICSINTERNETMP19001A_B_P":{"id":"MP19001A_B_P","fullName":"ElectronicsInternet.MP19001A_B_P","alias":"2023 Have Internet Access at Home: Percent","fieldName":"ELECTRONICSINTERNETMP19001A_B_P","precision":2,"calculatorName":"dataCollectionsCalculator","templateName":"dataCollectionsCalculator.ELECTRONICSINTERNETMP19001A_B_P","type":"esriFieldTypeDouble","vintage":"2023","source":"Esri-MRI-Simmons","definition":"Esri 2023 estimate of the expected number of adults and Market Potential Index (MPI) for <em>2023 Have Internet Access at Home</em> in t
